import logo from './logo.svg';
import './App.css';
import axios from 'axios';

const api = axios.create({
  baseURL:"https://run.mocky.io/v3/ca9cea67-7d2e-4cde-860b-1f50f3901296"
})

function App() {
  state = {
    courses:[]
  }
  api.get('/').then(res => {
    console.log(res.data)
    this.setState({courses: res.data})
  })
  return (
    this.state.courses.map(courses => <h2 key={courses.id}>{courses.title}</h2>
      )

  );
}

export default App;
